import React, { useState } from "react";

import { Menu, MenuItem } from "react-pro-sidebar";

import { Button, Img, Line, Text } from "components";
import Sidebar1 from "components/Sidebar1";
import StudentProfile from "components/StudentProfile";
import SidebarOverlay from "components/SidebarOverlay";
import Footer from "components/Footer";
import { Link, useNavigate } from "react-router-dom";

const FrameOnePage = () => {
  function handleNavigate() {
    const win = window.open("https://umat.edu.gh", "_blank");
    win.focus();
  }
  const navigate = useNavigate();
  const handleMySubmissionsClick = () => {
    // Navigate to the new page when the button is clicked
    navigate("/MySubmissions");
  };
  const [isOpen, setIsOpen] = useState(false);

  const openNav = () => {
    setIsOpen(true);
  };
  return (
    <>
      <div className="flex flex-col-3 page-content bg-white-A700 font-inika mx-auto relative h-full w-full">
        <div className="md:relative col-span-1 h-full">
          <Sidebar1
            openNav={openNav}
            className=" h-full bg-teal-900 flex justify-start left-[0] top-[0]"
          />
        </div>

        <div className="relative col-span-2 items-center justify-start  md:ml-[0] w-full">
          <div className="mb-[5%]">
            <StudentProfile />
          </div>
          <div className="absolute bottom-0">
          <Footer />
          </div>
        </div>
      </div>
    </>
  );
};

export default FrameOnePage;

